import React, { Component } from "react";
import { Col, Row, Container } from "../components/Grid";
import Jumbotron from "../components/Jumbotron";

function Home() {
    return (
      <Container fluid>
        <Row>
          <Col size="md-12">
            <Jumbotron className="Home">
              <h1>NewsIt</h1>
            </Jumbotron>
          </Col>
        </Row>
      </Container>
    );
  }

  export default Home;
